css:
@keyframes bracket-animation {
  from {
    border-color: #808080;
  }
  40% {
    border-color: rgba(51, 51, 51, 0.615);
  }
  to {
    border-color: rgba(51, 51, 51, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(51, 51, 51, 0.45);
}
